var _setLoadState = function(newState){
	var prevState;
	prevState = _loadState;
	function unsetPrev(params){
		for (var i = 0; i < params.elements.length; i++) {
			if(params.custom !== undefined){
				$($(params.elements)[0]).remove();
			} else {
				$($(params.elements[i])[0]).removeClass("ct-load-state-image");
				$($(params.elements[i])[0]).css('background-image','none');
			}
		}	
	};
	function setNew(params){
		for (var i = 0; i < params.elements.length; i++) {
			if(params.custom !== undefined){
				var container = $($(params.elements[i])[0]);
				$($(params.custom.container)[0]).append($(params.custom.image));
			} else {
				$($(params.elements[i])[0]).addClass("ct-load-state-image");
				if(params.image !== null){
					$($(params.elements[i])[0]).css('background-image','url(\''+params.image+'\')');
				}	
			}
		}	
	};
	if(_config.loadStateImages[prevState] !== undefined){
		unsetPrev(
			_config.loadStateImages[prevState]
		);
	}	
	if(_config.loadStateImages[newState] !== undefined){
		setNew(
			_config.loadStateImages[newState]
		);
	}	
	if(newState === 'error'){
		renderModule.destroyContent();
	}
	_loadState = newState;	
}

