// CLASS UIELement
var UIElement = function(options){
	var that = this
	this.elementID = options.elementID;
	this.template = options.template; 
	this.anchor = options.anchor;
	this.relation = options.relation || 'child';
	this.data = options.data;
	this.map = options.map || {};
	this.reference = null;
	this.attachToDom = function(options) {
	    var elementID = options.elementID;
	    var template = options.template;
	    var anchor = options.anchor;
	    var relation = options.relation;
	    var data = options.data;
	    var map = options.map;
	    var options = options.options;
	    var relationship;
	    relation !== undefined ? relationship = relation : 'child';
	    var newElement, _options;
	    _options = {
	        animate: false
	    }
	    _options = $.extend(
	        {},
	        _options,
	        options || {}
	    );
	    if(data !== undefined){
		    newElement = $(_populateTemplate(template, data, map))[0];
	    } else {
	    	newElement = $(template)[0];
	    }

	    // console.log(newElement)
	    if(elementID !== null){
	        $(newElement).attr('id', elementID);
	    }

	    if (_options.animate === true) {
	        // $(newElement.fadeIn(_config.animate));
	    }

	    // render element to DOM and return a reference to it   
	    if (relationship === 'child') {
	        $(anchor).append(newElement);
	        return newElement;
	    } else if (relationship === 'sibling') {
	        $(anchor).after(newElement);
	        return newElement;
	    }           
	}
	// transform double-bracketed dynamic data values in html template(string) into literal values using data(obj) and associated map(obj)
	function _populateTemplate(template, data, map) {
	    for (var attribute in map) {
	        if (map.hasOwnProperty(attribute)) {
	            var mappedAttr = map[attribute];
	            // mappings requiring filters 
	            if (attribute === 'price') {
	                template = template.replace('[[' + attribute + ']]', Number(data[mappedAttr]).toFixed(2));
	            } else {
	                if(attribute === 'customLabel' || attribute === 'custom2Label'){
	                    // apply custom labeling for those respective templates
	                    template = template.replace('[[' + attribute + ']]', mappedAttr);
	                } else {
	                	// console.log(data)
	                	// console.log(mappedAttr)

	                    template = template.replace('[[' + attribute + ']]', data[mappedAttr]);
	                }   
	            }
	        }
	    }
	    return template;
	}
	return;
}
UIElement.prototype.render = function(){
	this.reference = this.attachToDom({
		elementID: this.elementID,
		template: this.template,
		anchor: this.anchor,
		relation: this.relation,
		data: this.data,
		map: this.map
	});	
	return;
}

module.exports = UIElement;

// CLASS FilterValue
function FilterValue(options){
	this.active = true;
	this.count = options.count;
	this.value = options.value;
	this.selected = options.selected || false;
	this.displayValue = options.displayValue || options.value;
	this.clear = function(){
		this.selected = false;
		this.resetCount();
	}
	this.toggle = function(){
		this.selected = !this.selected;
		return this;
	}
	this.resetCount = function(){
		this.count = 0;
		this.setActive(false);
	}
	this.updateCount = function(newCount){
		this.count = newCount;

		if(newCount === 0){
			this.setActive(false);
		} else {
			this.setActive(true);
		}
		return this;
	}	
	this.setActive = function(isActive){
		this.active = isActive;
	}
}
