function Slider(options){
// noUISlider library
	
	Control.call(this, options);
	var context = this;
	console.log(window.noUiSlider)
	this.minValue = options.minValue;
	this.maxValue = options.maxValue;
	this.currentMin = options.minValue;
	this.currentMax = options.maxValue;
	this.elementID = null;
	this.filterName = options.filterName;;
	this.displayName = options.displayName || '';
	this.sliderReference = options.sliderReference;
	this.eventHandlerRef = options.eventHandlerRef;
	this.sliderHandles = [this.currentMin, this.currentMax];

	this.setHandlePositions = function(handlePositions){
		this.sliderHandles = handlePositions;
	}
	// this.setRange = function(range){
	// 	console.log(range);
	// 	this.minValue = range[1];
	// 	this.maxValue = range[0];
	// }
	this.update = function(values){
		var newMin = values.valueMin;
		var newMax = values.valueMax;
		if(values.rangeMin === null){
			newMin = this.sliderHandles[0];
		} else {
			this.sliderHandles[0] = newMin;
			this.minValue = newMin;
		}
		if(values.rangeMax === null){
			newMax = this.sliderHandles[1];
		} else {
			this.sliderHandles[1] = newMax;
			this.maxValue = newMax; 
		}

		this.currentMin = newMin;
		this.currentMax = newMax;			
	}
	this.reset = function(newMin, newMax){
		this.minValue = newMin;
		this.maxValue = newMax;
		this.currentMin = this.newMin;
		this.currentMax = this.newMax;
		this.sliderHandles = [this.newMin, this.newMax];
	}
	this.clear = function(){
		this.minValue = null;
		this.maxValue = null;
		this.currentMin = null;
		this.currentMax = null;
		this.sliderHandles = [null,null];
	}	
	this.render = function(){
		var wrapper,
			header,
			sliderWrapper;
		if(this.currentMin === this.currentMax || this.currentMin > this.currentMax){
			return // invalid parameters, something went wrong
		}
		this.elementID = 'ct-slider-'+this.filterName.replace(/\s/g, '');
		wrapper = $(this.template)[0];							
	 	header = $('<div class="ct-filter-heading ct-slider-">'+this.displayName+'</div>');
		sliderWrapper = $('<div class="ct-slider-control-wrapper"></div>')[0];
		$(sliderWrapper).attr('id', this.elementID);
		$(wrapper).append($(header));	
		$(wrapper).append($(sliderWrapper));	
		
		this.reference = this.attachToDom({
			template: (wrapper),
			data: null,
			anchor: this.anchor,
			relation: this.relation,
		});		
		// attach the slider to parent element using elementID as reference
		this.createSlider(this.elementID);	
	}

	this.createSlider = function(elementID){
		this.sliderReference = document.getElementById(elementID);
		noUiSlider.create(this.sliderReference, {
			start: [
				this.currentMin, 
				this.currentMax
			],
			range: {
				'min': this.minValue,
				'max': this.maxValue
			},
			pips: {
				mode: 'count',
				values: 5
			},
			connect: true,
			tooltips: true,	
			format: {
			  	to: function ( value ) {
					return '$'+value.toFixed(2);
			  	},
			  	from: function ( value ) {
					return value
			  	}
			},  	
			orientation: 'horizontal'
		});

		this.bindSlider(this.sliderReference, this);	

	}
	this.bindSlider = function(slider, obj){
		slider.noUiSlider.on('set', function(){			
			var eventHandler = stateModule._eventHandler;	
			eventHandler.sliderMoved(slider.noUiSlider.get(), obj);
		});
	}
} 

module.exports = Slider;

