var configModule = require('../modules/configModule');
var stateModule = require('../modules/stateModule');

var callSearchAPI = function(params){
	
    return new Promise(function (resolve, reject) {

        var error = false;
        if(params.appId === null || params.catalogId === null || params.trackingId === null || params.sessionId === null){
            return null;
        }
    	return makeCall(constructRequest());

    	function constructRequest(){
    		// set error flag if any required parameter is null
    		if(
    			params.searchTerm === null || params.searchTerm === undefined ||
    			params.numResults === null || params.numResults === undefined ||
    			params.pageNumber === null || params.pageNumber === undefined ||
    			params.sortOption === null || params.sortOption === undefined ||
    			params.filters === null  || params.filters === undefined
    		){
    			error = true;
    			return {url:null, payload:null, error: "missing required parameter"};
    		}
    		var url = 'https://api.certona.com/Resonance/Application/' + params.appId + '/Search';
    		var payload = null;

    		payload =
    		    JSON.stringify({
    		        "search": {
    		            "searchTerm": params.searchTerm,
    		            "queryType":  params.queryType,
    		            "catalogId":  params.catalogId,
    		            "trackingId": params.trackingId,
    		            "sessionId":  params.sessionId,
    		            "numResults": params.numResults,
    		            "pageNumber": params.pageNumber,
    		            "sortOption": params.sortOption,
    		            "filters":    params.filters 
    		        }
    		    });
    		return {url:url, payload:payload};    
    	}
        
        function makeCall(request){
        	if(error === true){
        		constructRequest.error = true;
        		stateModule._setLoadState('error');
        		return reject(request.error);
        	}
        	jQuery.ajax({
        	    url: request.url,
        	    type: 'POST',
        	    data: request.payload,
        	    contentType: 'application/json',
        	    success: function (response) {
        	    	console.log(response);
        	    	ajaxSuccess(response);
        	    },
        	    error: function (xhr, status, error) {
        	        ajaxError(xhr, status, error);
        	    }, 
        	    timeout: params.timeout
        	}); //ajax
        }
        function ajaxSuccess(response){
        	if(response.success === true){
        		stateModule._setLoadState('success');
        	} else {
	        	stateModule._setLoadState('error');
        	}
        	resolve(response);
        }
        function ajaxError(objAJAXRequest, strError){                        
        	if(stateModule._state.appInitialized === false && strError === 'timeout'){
        		stateModule._setLoadState('error');
                return;
        	}
        	stateModule._setLoadState('error');
        	reject(strError);
        }   
    }); //promise	
}

module.exports = {
    callSearchAPI: callSearchAPI
