    	// add the generated payload to search state
    	function addPayload(index){
    		if(values[0] !== values[1]){
	    		state.searchState.filters.push(createPayload(values));
	    	}	
    	}
    	
    	removePrevious();
		state.searchState.filters.push(composePayload());	
    	stateModule._setState(state);
		// finally, tell the Router about the change in order to make a new API call and update results
		return _searchRouter.controlChanged('slider');

    }
    // EventHandler.dispatcher //
    // registers the list of available event handlers and implements their behavior.
	this.dispatcher = {	 	
		expandFilter: function(e){
			var state,
				target,
				filterWrapper, 
