			valueObj = filter.findFilterValue(filterValue).toggle();
			selected = valueObj.selected;
			
			// adjust current search state accordingly
			if(selected === true){
				newFilter = {
					filterName: filterName,
					filterOperation: '=',
					filterValues: [filterValue]
				}	
				state.searchState.filters.push(newFilter);
			} else {
				// remove the filter value
			
				for (var i = 0; i < state.searchState.filters.length; i++) {
					if(state.searchState.filters[i].filterName === filterName){
						currentFilter = state.searchState.filters[i];
						// found filter, now find filterValue
						for (var j = 0; j < currentFilter.filterValues.length; j++) {
							// remove that filterValue
							currentFilter.filterValues.splice(j, 1);
							// then, if the filterValues array is now empty, remove the filter as well
							if(state.searchState.filters[i].filterValues.length === 0){
								state.searchState.filters.splice(i, 1);
							}
						}
					}
				}	
			}
			for (var i = 0; i < state.searchState.filters.length; i++) {
				
				if(state.searchState.filters[i].filterOperation === 'between'){ // it's a slider, remove it
					state.searchState.filters.splice(i, 1);
				}
			}
			stateModule._setState(state);
			// then tell the Router about the change in order to make a new API call and update results
			return _searchRouter.controlChanged('filter');
		},
		toggleMinimize: function(e){
			var filterWrapper,
				filterName, 
				filter;

			state = stateModule._getState();
			target = $(this.target)[0];
			filterWrapper = $($(target).parent()[0]).parent()[0];
			filterName = $(filterWrapper).attr('data-filtername');
			filter = dataModule.findFilter(state.searchResults.filters, filterName);
			filter.toggleMinimize();
			console.log(filter.minimized);
			if(filter.minimized === true){
				$(filterWrapper).addClass("ct-minimized");
			} else {
				$(filterWrapper).removeClass("ct-minimized");	
			}

			stateModule._setState(state);
		},
		sortOptionChanged: function(e){ 
			// var state = _getState();
			// var _searchRouter = stateModule._searchRouter;
			// var newOption = this.target.value;
			// if(newOption !== state.searchState.sortOption){
			// 	state.searchState.sortOption = newOption; 
			// 	_setState(state);
			// 	return _searchRouter.controlChanged('sortOption');
			// }
			// _setState();
		},
		setCurrentPage: function(e){
			var state,
				newPageNumber;
			var _searchRouter = stateModule._searchRouter;
			state = stateModule._getState();
			newPageNumber = $(this.target).attr('data-page');
			state.searchState.pageNumber = newPageNumber;		
			stateModule._setState(state);
			return _searchRouter.controlChanged();
		},
		clearAll: function(e){
			var state,
				listingFilter;	
			var _searchRouter = stateModule._searchRouter;
			state = stateModule._getState();
			listingFilter = null;
			if(_config.searchParams.applicationType === 'listing'){
				for (var i = 0; i < state.searchState.filters.length; i++) {
					if(state.searchState.filters[i].listing === true){
						listingFilter = state.searchState.filters[i];
						break;
					} 
				}
			}	
			for (var i = 0; i < state.searchResults.filters.length; i++) {
				state.searchResults.filters[i].clear();
			}	
			
			state.searchState.filters = [];
			if(listingFilter !== null){
				state.searchState.filters.push(listingFilter);
			}
			
			stateModule._setState(state);

			return _searchRouter.controlChanged('filter');
		},
		toggleMobileFilters: function(e){
			var state = stateModule._getState();
			state.mobileFiltersVisible = !state.mobileFiltersVisible;
			if(state.mobileFiltersVisible === true){
				$($(state.UIRefs.filterControls)[0]).addClass('ct-show');
			} else {
				$($(state.UIRefs.filterControls)[0]).removeClass('ct-show');
			}
			stateModule._setState(state);
		}
	}		
}	

