// Routing
// Uses current Search State and to construct and route the appropriate payload to the _callAPI method, and then 
// resets or modifies the dynamic state properities (reset page number, filters, and sortOptions accordingly). 
// Results are then passed to _updateSearchResults
//*******************
	
var Router = function(){
	var router = this;
	
	this.initialize = function(){

	    return new Promise(function (resolve, reject) {

			var config, 
				state, 
				searchData, 
				newSearchState, 
				results,
				searchTerm;
			
			config = configModule._getConfig();
			state = stateModule._getState();
			renderModule.initializeUI(state, config);
			stateModule._setLoadState('init');
			newSearchState = state.searchState;

			// set searchTerm
			newSearchState.filters = [];
			if(config.searchParams.applicationType === 'search'){
				if(typeof(config.searchTerm) !== 'undefined' ){
					newSearchState.searchTerm = config.searchTerm;
				} else {
					console.log("Error: no searchTerm found during CertonaSearch initialization");
				}	
			} else {
				newSearchState.searchTerm = "";
				newSearchState.filters.push(config.listingFilter);
			}
			// update searchState before constructing request
			state.searchState = newSearchState;
			searchData = {
				searchTerm: newSearchState.searchTerm,
				pageNumber: newSearchState.pageNumber,
				sortOption: newSearchState.sortOption,
				filters: 	newSearchState.filters,
				numResults: config.searchParams.numResults,
				queryType: 	config.searchParams.applicationType,
	            catalogId:  config.searchParams.catalogId,
	            trackingId: config.searchParams.trackingId,
	            sessionId:  config.searchParams.sessionId,
	            appId: 		config.searchParams.appId,
	            timeout: 	config.timeout
			}
			// make call 
			
			router.fetchResults(searchData, config).then(function(results){
				if(results.errors.length === 0){
					state.searchResults = dataModule.updateSearchResults(state, config, results);			
					state =  renderModule.renderUI(state, config);
					state.appInitialized = true;			
				} else {
					// handle errors
				} 
				configModule._setConfig(config); 
				stateModule._setState(state);
				resolve();
			});
	    }); //promise		
	}
	this.controlChanged = function(controlType){
		var config, 
			state,
			searchData, 
			results,
			currentFilter;

		config = configModule._getConfig();
		state = stateModule._getState();

		$(state.UIRefs.displayGrid).empty();
		$(state.UIRefs.displayGrid).append($('<div id="ct-load-state-overlay" class="ct-load-state-overlay -load-state-overlay-custom"></div>'));
		stateModule._setLoadState('loading');
		// zero out counts to be update in _updateSearchResults. Since the API does not return filterValues
		// with count=0, we have to zero out all the filters and then reset the counts, inactivating the ones that still 
		// have count equal to 0
		for (var i = 0; i < state.searchResults.filters.length; i++) {
			if(!(state.searchResults.filters[i] instanceof Slider)){
				state.searchResults.filters[i].resetCounts(state.searchResults.filters[i].values);
			}
		}
		// check if unique actions need to be taken BEFORE the API call to set search parameters
		if(typeof(controlType) !== 'undefined'){
			state = router.dynamicStateUpdate()[controlType](state, config);
		}
		// fetch search parameters
		searchData = {
			searchTerm: state.searchState.searchTerm,
			numResults: config.searchParams.numResults,
			pageNumber: state.searchState.pageNumber,
			sortOption: state.searchState.sortOption,
			filters: 	state.searchState.filters,
			queryType: 	config.searchParams.applicationType,
            catalogId:  config.searchParams.catalogId,
            trackingId: config.searchParams.trackingId,
            sessionId:  config.searchParams.sessionId,
            appId: 		config.searchParams.appId,
            timeout: 	config.timeout
		}
		
		// update searchState before constructing request
		router.fetchResults(searchData, config).then(function(results){
			if(results.errors.length === 0){	
				state.searchResults = dataModule.updateSearchResults(state, config, results, controlType);
				renderModule.renderUI(state, config, controlType);
			} else {
				// handle errors
			} 
		});
		configModule._setConfig(config); 
		stateModule._setState(state);
	}

	// update bits of state used to update the dynamic portions of the application in reaction to certain actions
	// that aren't shared by all actions and can't be accounted for in router.controlChanged()
	this.dynamicStateUpdate = function(state, config, options){
		function filter(state, options){
			// reset results to the first page
			state.searchState.pageNumber = 1;
			return state;
		}
		function slider(state, options){
			state.searchState.pageNumber = 1;
			return state;
		}
		function searchTerm(state, options){
			// reset all UI elements to their initialized state.
			state.searchResults.filters = [];
			state.searchResults.items = [];
			// state.searchResults.sortOption.reset();
			state.searchResults.pagingControl.reset();
			state.searchState.searchTerm = state.searchBar.obj.value;
			state.searchState.pageNumber = 1;
			state.searchState.sortOption =  1;
			state.searchState.filters = [];
			// state = _resetControls(state, config)
			return state;
		}
		return {
			filter: filter,
			searchTerm: searchTerm,
			slider: slider
		}	
	}
	
	this.fetchResults = function(searchData, config){
		// we need to wait for the response promise to resolve before we continue, 
		// because we need the results to construct the HTML scaffolding and update filters, 
		// so we return the results in a promise and continue on the then() callback
		return new Promise(function (resolve, reject) {
			networkModule.callSearchAPI(searchData, config).then(function(data) {
		   		resolve(data);
			}, function(reason) {
			  	reject(reason);
			});
		});	
	}			
} // end Router

module.exports = Router;

